import React, { Fragment } from 'react';
import "./styles.css";
import Breadcrumb from '../../../../../../../../layout/breadcrumb';
import { Container, Row, Col, Card, CardBody, CardHeader } from "reactstrap";

const ViewPreviouslySubmittedDataHackerAccountHelper = (props) => {
    return (
        <Fragment>
            <Breadcrumb parent="View Previously Submitted Data/Information!" title="View/Manage Your Submitted Information.."/>
            <Container fluid={true}>
                <Row>
                    <Col sm="12" md="12" lg="12" xl="12">
                        <Card className='shadow'>
                            <CardHeader className='b-l-info b-r-info'>

                            </CardHeader>
                        </Card>
                    </Col>
                </Row>
            </Container>
        </Fragment>
    );
}

export default ViewPreviouslySubmittedDataHackerAccountHelper;
